import myMap from "../../images/map.png";
const Map = () => {
  return (
    <div className="bg-amber-600 mt-8 col-span-1 mr-20 rounded-lg pt-5 ">
      <div className="info-logo mb-5 font-serif text-center ">
        <h1 className="border-2 text-slate-50 rounded-full ">i</h1>
      </div>
      <img className="rounded-lg" src={myMap} alt="" />
    </div>
  );
};
export default Map;
